function Stack:__init()
    self.stack = {first = 0, last = -1, size = 0}
end

function Stack:push(element)
    local last = self.stack.last + 1
    self.stack.last = last
    self.stack[last] = element
    self.stack.size = self.stack.size + 1
end

function Stack:pop()
    local last = self.stack.last
    if self.stack.first > last then return nil end
    local element = self.stack[last]
    self.stack[last] = nil         -- to allow garbage collection
    self.stack.last = last - 1
    self.stack.size = self.stack.size - 1
    return element
end

function Stack:peek()
    local last = self.stack.last
    if self.stack.first > last then return nil end
    return self.stack[last]
end

function Stack:size()
    return self.stack.size
end

function Stack:clear()
    self.stack = nil
    self.stack = {first = 0, last = -1, size = 0}
end
